import React, { useEffect, useState } from "react";

const API_URL = "http://localhost:5000/api"; // backend local

function App() {
  const [motoboys, setMotoboys] = useState([]);
  const [pedidos, setPedidos] = useState([]);
  const [novoMotoboy, setNovoMotoboy] = useState({ nome: "", telefone: "" });
  const [novoPedido, setNovoPedido] = useState({ cliente: "", item: "" });

  // ðŸ”¹ Carregar dados
  useEffect(() => {
    carregarMotoboys();
    carregarPedidos();
  }, []);

  const carregarMotoboys = async () => {
    const res = await fetch(`${API_URL}/motoboys`);
    const data = await res.json();
    setMotoboys(data);
  };

  const carregarPedidos = async () => {
    const res = await fetch(`${API_URL}/pedidos`);
    const data = await res.json();
    setPedidos(data);
  };

  // ðŸ”¹ Adicionar motoboy
  const adicionarMotoboy = async () => {
    if (!novoMotoboy.nome || !novoMotoboy.telefone) return;
    await fetch(`${API_URL}/motoboys`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(novoMotoboy),
    });
    setNovoMotoboy({ nome: "", telefone: "" });
    carregarMotoboys();
  };

  // ðŸ”¹ Adicionar pedido
  const adicionarPedido = async () => {
    if (!novoPedido.cliente || !novoPedido.item) return;
    await fetch(`${API_URL}/pedidos`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(novoPedido),
    });
    setNovoPedido({ cliente: "", item: "" });
    carregarPedidos();
  };

  return (
    <div className="min-h-screen bg-white text-gray-800 flex flex-col items-center p-8">
      <div className="w-full max-w-2xl">
        <h1 className="text-3xl font-bold flex items-center gap-2 mb-8">
          ðŸ“¦ Delivery App
        </h1>

        {/* ==== Motoboys ==== */}
        <section className="bg-gray-50 rounded-2xl shadow p-6 mb-8">
          <h2 className="text-xl font-semibold flex items-center gap-2 mb-4">
            ðŸ›µ Motoboys
          </h2>

          <div className="flex gap-2 mb-4">
            <input
              type="text"
              placeholder="Nome"
              value={novoMotoboy.nome}
              onChange={(e) =>
                setNovoMotoboy({ ...novoMotoboy, nome: e.target.value })
              }
              className="flex-1 border border-gray-300 rounded-lg px-3 py-2"
            />
            <input
              type="text"
              placeholder="Telefone"
              value={novoMotoboy.telefone}
              onChange={(e) =>
                setNovoMotoboy({ ...novoMotoboy, telefone: e.target.value })
              }
              className="flex-1 border border-gray-300 rounded-lg px-3 py-2"
            />
            <button
              onClick={adicionarMotoboy}
              className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition"
            >
              Adicionar
            </button>
          </div>

          <ul className="divide-y divide-gray-200">
            {motoboys.map((m) => (
              <li key={m._id} className="py-2 flex justify-between">
                <span>
                  <strong>{m.nome}</strong> â€” {m.telefone}
                </span>
                <span className="text-sm text-gray-500">{m.status}</span>
              </li>
            ))}
          </ul>
        </section>

        {/* ==== Pedidos ==== */}
        <section className="bg-gray-50 rounded-2xl shadow p-6">
          <h2 className="text-xl font-semibold flex items-center gap-2 mb-4">
            ðŸ“¦ Pedidos
          </h2>

          <div className="flex gap-2 mb-4">
            <input
              type="text"
              placeholder="Cliente"
              value={novoPedido.cliente}
              onChange={(e) =>
                setNovoPedido({ ...novoPedido, cliente: e.target.value })
              }
              className="flex-1 border border-gray-300 rounded-lg px-3 py-2"
            />
            <input
              type="text"
              placeholder="Item"
              value={novoPedido.item}
              onChange={(e) =>
                setNovoPedido({ ...novoPedido, item: e.target.value })
              }
              className="flex-1 border border-gray-300 rounded-lg px-3 py-2"
            />
            <button
              onClick={adicionarPedido}
              className="bg-green-600 text-white px-4 py-2 rounded-lg hover:bg-green-700 transition"
            >
              Adicionar
            </button>
          </div>

          <ul className="divide-y divide-gray-200">
            {pedidos.map((p) => (
              <li key={p._id} className="py-2">
                <strong>{p.cliente}</strong> â€” {p.item}{" "}
                <span className="text-sm text-gray-500">({p.status})</span>
              </li>
            ))}
          </ul>
        </section>
      </div>
    </div>
  );
}

export default App;
